// Import all images
import image1 from "../images/bdtronic_slide.png";
import image2 from "../images/codershub_slide.png";
import image3 from "../images/dreilinden_slide.png";
import image4 from "../images/reya_slide.png";
import image5 from "../images/coop_slide.png";
import image6 from "../images/kw3-2slider.png";

// Original array of images
export const originalImages = [image1, image2, image3, image4, image5, image6];

